description:
⛳️⛳️ Hoa hậu đất phân lô đấu giá Hồng Sơn (Mỹ Đức) mới ra lò, chỉ nhỉnh 10tr/m2. Nhanh tay kẻo bay mất!
⛳️⛳️ Diện tích 110,5m2, Lô 2 mặt tiền trước - sau, chia 2 lô cực đẹp;
⛳️⛳️ Đất full thổ cư, đường bê tông 6m chia ô bàn cờ, mặt tiền 5,4m;
⛳️⛳️ Nằm trước nhà văn hóa, xung quanh tiện ích không thiếu gì : sân bóng, nhà văn hóa, trường học, trạm y tế, cây xăng;
⛳️⛳️ Cách đường tỉnh lộ 419 chỉ 70m, sổ đỏ nét căng;
LH em Siêu để làm việc chính chủ
